import React, { useState } from 'react';
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  IconButton, 
  Box, 
  Menu, 
  MenuItem, 
  Badge, 
  Divider, 
  ListItemIcon, 
  ListItemText,
  Tooltip,
  Avatar,
  List,
  ListItem,
  Paper,
  Popover,
  Button,
  Switch,
  FormControlLabel
} from '@mui/material';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import NotificationsIcon from '@mui/icons-material/Notifications';
import HelpIcon from '@mui/icons-material/Help';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import SettingsIcon from '@mui/icons-material/Settings';
import LogoutIcon from '@mui/icons-material/Logout';
import InfoIcon from '@mui/icons-material/Info';
import KeyboardIcon from '@mui/icons-material/Keyboard';
import Brightness4Icon from '@mui/icons-material/Brightness4';
import Brightness7Icon from '@mui/icons-material/Brightness7';
import { useContext } from 'react';
import { ColorModeContext } from '../../App';

const Header = () => {
  const navigate = useNavigate();
  const { mode, toggleColorMode } = useContext(ColorModeContext);

  // State for notification menu
  const [notificationAnchorEl, setNotificationAnchorEl] = useState(null);
  const notificationOpen = Boolean(notificationAnchorEl);
  const [notifications, setNotifications] = useState([
    {
      id: 1,
      message: 'New security vulnerabilities found in project "Spring Boot App"',
      read: false,
      timestamp: '10 minutes ago'
    },
    {
      id: 2,
      message: 'Analysis completed for project "E-commerce Backend"',
      read: false,
      timestamp: '1 hour ago'
    },
    {
      id: 3,
      message: '5 dependencies are outdated in "Microservice API"',
      read: true,
      timestamp: 'Yesterday'
    }
  ]);

  // State for help menu
  const [helpAnchorEl, setHelpAnchorEl] = useState(null);
  const helpOpen = Boolean(helpAnchorEl);

  // State for user menu
  const [userAnchorEl, setUserAnchorEl] = useState(null);
  const userOpen = Boolean(userAnchorEl);

  // Event handlers for notification menu
  const handleNotificationClick = (event) => {
    setNotificationAnchorEl(event.currentTarget);
  };

  const handleNotificationClose = () => {
    setNotificationAnchorEl(null);
  };

  const handleReadNotification = (id) => {
    setNotifications(notifications.map(notification => 
      notification.id === id ? { ...notification, read: true } : notification
    ));
  };

  const handleClearAllNotifications = () => {
    setNotifications([]);
    handleNotificationClose();
  };

  // Event handlers for help menu
  const handleHelpClick = (event) => {
    setHelpAnchorEl(event.currentTarget);
  };

  const handleHelpClose = () => {
    setHelpAnchorEl(null);
  };

  // Event handlers for user menu
  const handleUserClick = (event) => {
    setUserAnchorEl(event.currentTarget);
  };

  const handleUserClose = () => {
    setUserAnchorEl(null);
  };

  // Count unread notifications
  const unreadCount = notifications.filter(notification => !notification.read).length;

  return (
    <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
      <Toolbar>
        <IconButton
          color="inherit"
          aria-label="open drawer"
          edge="start"
          sx={{ mr: 2, display: { sm: 'none' } }}
        >
          <MenuIcon />
        </IconButton>

        <Typography
          variant="h6"
          component={RouterLink}
          to="/"
          sx={{ 
            color: 'white', 
            textDecoration: 'none',
            fontWeight: 'bold',
            flexGrow: 1
          }}
        >
          Maven Dependency Analyzer
        </Typography>

        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          {/* Notifications Icon */}
          <Tooltip title="Notifications">
            <IconButton 
              color="inherit" 
              size="large"
              onClick={handleNotificationClick}
              aria-controls={notificationOpen ? "notification-menu" : undefined}
              aria-haspopup="true"
              aria-expanded={notificationOpen ? "true" : undefined}
            >
              <Badge badgeContent={unreadCount} color="error">
                <NotificationsIcon />
              </Badge>
            </IconButton>
          </Tooltip>

          {/* Notification Menu */}
          <Menu
            id="notification-menu"
            anchorEl={notificationAnchorEl}
            open={notificationOpen}
            onClose={handleNotificationClose}
            PaperProps={{
              elevation: 3,
              sx: { width: 350, maxHeight: 500 }
            }}
            transformOrigin={{ horizontal: 'right', vertical: 'top' }}
            anchorOrigin={{ horizontal: 'right', vertical: 'bottom' }}
          >
            <Box sx={{ p: 2, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Typography variant="h6">Notifications</Typography>
              {notifications.length > 0 && (
                <Button 
                  variant="text" 
                  size="small" 
                  onClick={handleClearAllNotifications}
                >
                  Clear All
                </Button>
              )}
            </Box>
            <Divider />
            {notifications.length > 0 ? (
              <List sx={{ py: 0 }}>
                {notifications.map(notification => (
                  <React.Fragment key={notification.id}>
                    <ListItem 
                      button 
                      onClick={() => {
                        handleReadNotification(notification.id);
                        handleNotificationClose();
                      }}
                      sx={{ 
                        bgcolor: notification.read ? 'transparent' : (theme) => 
                          theme.palette.mode === 'light' ? 'rgba(33, 150, 243, 0.1)' : 'rgba(33, 150, 243, 0.2)'
                      }}
                    >
                      <ListItemText 
                        primary={notification.message} 
                        secondary={notification.timestamp}
                        primaryTypographyProps={{ 
                          variant: 'body2',
                          fontWeight: notification.read ? 'normal' : 'medium'
                        }}
                      />
                    </ListItem>
                    <Divider />
                  </React.Fragment>
                ))}
              </List>
            ) : (
              <Box sx={{ p: 3, textAlign: 'center' }}>
                <Typography color="text.secondary">No notifications</Typography>
              </Box>
            )}
          </Menu>

          {/* Help Icon */}
          <Tooltip title="Help">
            <IconButton 
              color="inherit" 
              size="large"
              onClick={handleHelpClick}
              aria-controls={helpOpen ? "help-menu" : undefined}
              aria-haspopup="true"
              aria-expanded={helpOpen ? "true" : undefined}
            >
              <HelpIcon />
            </IconButton>
          </Tooltip>

          {/* Help Menu */}
          <Menu
            id="help-menu"
            anchorEl={helpAnchorEl}
            open={helpOpen}
            onClose={handleHelpClose}
            PaperProps={{
              elevation: 3,
              sx: { width: 250 }
            }}
            transformOrigin={{ horizontal: 'right', vertical: 'top' }}
            anchorOrigin={{ horizontal: 'right', vertical: 'bottom' }}
          >
            <MenuItem 
              onClick={() => {
                // More reliable way to access the Documentation dialog in the footer
                const footerLinks = document.querySelectorAll('footer a');
                const docLink = Array.from(footerLinks).find(link => 
                  link.textContent && link.textContent.includes('Documentation')
                );
                if (docLink) {
                  docLink.click();
                }
                handleHelpClose();
              }}
            >
              <ListItemIcon>
                <InfoIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText>Documentation</ListItemText>
            </MenuItem>
            <MenuItem 
              onClick={() => {
                // Find the support link in footer
                const footerLinks = document.querySelectorAll('footer a');
                const supportLink = Array.from(footerLinks).find(link => 
                  link.textContent && link.textContent.includes('Support')
                );
                if (supportLink) {
                  supportLink.click();
                }
                handleHelpClose();
              }}
            >
              <ListItemIcon>
                <HelpIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText>Contact Support</ListItemText>
            </MenuItem>
          </Menu>

          {/* User Profile Icon */}
          <Box sx={{ ml: 2 }}>
            <Tooltip title="Account settings">
              <IconButton 
                color="inherit" 
                size="large"
                onClick={handleUserClick}
                aria-controls={userOpen ? "user-menu" : undefined}
                aria-haspopup="true"
                aria-expanded={userOpen ? "true" : undefined}
              >
                <AccountCircleIcon />
              </IconButton>
            </Tooltip>
          </Box>

          {/* User Profile Menu */}
          <Menu
            id="user-menu"
            anchorEl={userAnchorEl}
            open={userOpen}
            onClose={handleUserClose}
            PaperProps={{
              elevation: 3,
              sx: { width: 220 }
            }}
            transformOrigin={{ horizontal: 'right', vertical: 'top' }}
            anchorOrigin={{ horizontal: 'right', vertical: 'bottom' }}
          >
            <Box sx={{ px: 2, py: 1.5 }}>
              <Typography variant="subtitle1" fontWeight="medium">User</Typography>
              <Typography variant="body2" color="text.secondary">admin@example.com</Typography>
            </Box>
            <Divider />
            <MenuItem 
              onClick={() => {
                navigate('/settings');
                handleUserClose();
              }}
            >
              <ListItemIcon>
                <SettingsIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText>Settings</ListItemText>
            </MenuItem>
            <MenuItem onClick={toggleColorMode}>
              <ListItemIcon>
                {mode === 'dark' ? <Brightness7Icon fontSize="small" /> : <Brightness4Icon fontSize="small" />}
              </ListItemIcon>
              <ListItemText>{mode === 'dark' ? 'Light Mode' : 'Dark Mode'}</ListItemText>
            </MenuItem>
            <Divider />
            <MenuItem onClick={handleUserClose}>
              <ListItemIcon>
                <LogoutIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText>Logout</ListItemText>
            </MenuItem>
          </Menu>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
